contracts/AirDrop.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract AirDrop {
    address public token;

    function getSum(uint256[] calldata arr) external pure returns(uint256 sum) {
        for (uint8 i; i < arr.length; i++) {
            sum += arr[i];
        }
    }
}

